import React, {useState, useEffect} from "react";

export default function RecipeList(props) {

    return (
        <div className="recipe-list">
            <h2>Recipes</h2>
            {props.recipes.map((recipe) => (
                <div className="recipe">
                <h4>{recipe.recipeName}</h4>
                </div>
            ))};
        </div>
    );
}
